import React from 'react'
import Bar from "react-chartjs-2";

function Chart() {
    const shit = [1,2,3,4,5,6]

    return (
        <div>
            <Bar data={shit}
                 width={250}
                 height={250}
            />
        </div>
    )
}

export default Chart
